import React, { useState } from "react";
import { Button } from "../../atoms";

const LikeBox = () => {
  const [cnt, setCnt] = useState(0);
  const addCnt = () => {
    setCnt((prev) => {
      prev++;
    });
  };
  const minusCnt = () => {
    if (cnt > 0) {
      setCnt((prev) => {
        prev--;
      });
    }
  };
  return <div>{cnt}</div>;
};

export default LikeBox;
